import React from "react"
import router from './reouter/index';
import { useRoutes } from "react-router-dom"
import { connect } from 'react-redux'
import './App.less'

function App (props) {
  const outlet = useRoutes(router)
  return (
    <>
      <div>{props.str}</div>
      {outlet}
    </>
  )

}

/**state映射 */
const mapStateToProps = (state) => {
  return {
    str: state.str
  }
}


export default App
